INSERT INTO `berita` (`id`, `slug`, `judul`, `isi`, `url`) VALUES
(1, 'UPDATE_4_Oktober:_Bertambah_3.992,_Kasus_Covid-19_di_Indonesia_Jadi_303.498', 'UPDATE 4 Oktober: Bertambah 3.992, Kasus Covid-19 di Indonesia Jadi 303.498', 'Angka penularan virus corona di Indonesia masih belum memperlihatkan tanda-tanda penurunan setelah pandemi berjalan sekitar tujuh bulan. Pemerintah menyatakan bahwa masih terjadi penularan yang menyebabkan kasus Covid-19 terus bertambah hingga Minggu (4/10/2020) hari ini. Data pemerintah pada Minggu pukul 12.00 WIB menunjukkan bahwa terdapat 3.992 kasus baru Covid-19 dalam 24 jam terakhir.', 'https://nasional.kompas.com/read/2020/10/04/15274751/update-4-oktober-bertambah-3992-kasus-covid-19-di-indonesia-jadi-303498'),
(2, 'Dokter:_Kondisi_Donald_Trump_yang_Positif_COVID-19_Membaik,_Kemungkinan_Pulang_dari_RS_5_Oktober', 'Dokter: Kondisi Donald Trump yang Positif COVID-19 Membaik, Kemungkinan Pulang dari RS 5 Oktober', 'Donald Trump diperkirakan bakal segera keluar dari rumah sakit tempat perawatan penyakit COVID-19 yang menginfeksinya. \"Presiden AS Donald Trump terus membaik setelah diagnosis positif COVID-19 dan kemungkinan dapat keluar dari rumah sakit paling cepat Senin (5 Oktober 2020 waktu AS),\" kata dokter kepresidenan seperti dikutip dari CNN, Senin (5/10/2020).', 'https://www.liputan6.com/global/read/4373793/dokter-kondisi-donald-trump-yang-positif-covid-19-membaik-kemungkinan-pulang-dari-rs-5-oktober'),
(3, 'IDI_Respons_Moeldoko:_Jangan_Tuduh_RS_Perkaya_Diri_Kala_Covid', 'IDI Respons Moeldoko: Jangan Tuduh RS Perkaya Diri Kala Covid', 'Jakarta, CNN Indonesia -- Ketua Umum Pengurus Besar Ikatan Dokter Indonesia (IDI), Daeng Faqih mengatakan rumah sakit sedang mengalami masa sulit bertarung dengan pandemi virus corona Covid-19, sehingga jangan dituduh bahwa RS memperkaya diri dari pasien Covid-19. Pernyataan tersebut merupakan respons dari tudingan Kepala Staf Presiden Moeldoko yang mengatakan banyak rumah sakit mencari keuntungan dari kematian pasien Covid-19, salah satunya dengan memaksa pasien mengaku kena corona. Menurut Daeng, rumah sakit saat ini justru kesulitan beroperasional karena banyak klaim pembayaran pasien Covid-19 yang belum dibayarkan oleh Kementerian Kesehatan. Padahal, pasien non Covid-19 juga menurun, sehingga biaya operasional juga ikut berkurang.\r\n', 'https://www.cnnindonesia.com/nasional/20201004141912-20-554177/idi-respons-moeldoko-jangan-tuduh-rs-perkaya-diri-kala-covid'),
(4, 'Daftar_62_Daerah_Berstatus_Zona_Merah_Covid-19_di_Indonesia', 'Daftar 62 Daerah Berstatus Zona Merah Covid-19 di Indonesia', 'Pada Minggu (4/10/2020), Indonesia mencatatkan tambahan 3.992 kasus infeksi virus corona. Dengan tambahan itu, Indonesia kini memiliki 303.498 total kasus Covid-19 sejak diumumkan pertama pada Maret 2020. Selain itu, Indonesia juga melaporkan 96 kematian baru akibat Covid-19, sehingga total menjadi 11.151. Angka kematian ini tertinggi di Asia Tenggara. Sementara, jumlah pasien yang sembuh kini mencapai 228.453 orang. Meski beragam upaya telah dilakukan untuk menahan laju penyebaran, angka kasus infeksi tak kunjung melandai. Bahkan, dalam periode sepuluh hari terakhir (25 September-4 Oktober 2020), rata-rata kasus harian mencapai 4.147. DKI Jakarta, Jawa Timur, dan Jawa Barat masih menjadi daerah dengan kasus infeksi tertinggi.\r\n', 'https://www.kompas.com/tren/read/2020/10/05/060200165/daftar-62-daerah-berstatus-zona-merah-covid-19-di-indonesia?page=all'),
(5, 'Cegah_Klaster_COVID-19,_Masyarakat_Harus_Paham_Potensi_Penularan', 'Cegah Klaster COVID-19, Masyarakat Harus Paham Potensi Penularan', '\r\nTim Pakar Satgas COVID-19 dr. Dewi Nur Aisyah mengatakan masyarakat harus bisa memahami penyebaran COVID-19. Pemahaman itu berguna untuk mencegah potensi penularan Corona yang bisa menimbulkan klaster-klaster baru. \"Jika salah satu rekan satu ruangan di kantor atau anggota keluarga positif COVID-19, maka kru sekantor dan keluarga wajib melakukan swab test. Selama hasil swab belum keluar semua wajib melakukan isolasi mandiri,\" ungkap Dewi, dikutip dari situs resmi covid19.go.id , Senin (5/10/2020).\r\n', 'https://news.detik.com/berita/d-5199977/cegah-klaster-covid-19-masyarakat-harus-paham-potensi-penularan'),
(6, 'PB_IDI:_3_Dokter_Kembali_Gugur_Akibat_COVID-19', 'PB IDI: 3 Dokter Kembali Gugur Akibat COVID-19', '\r\nPengurus Besar (PB) Ikatan Dokter Indonesia (IDI) menyampaikan kabar duka tiga dokter kembali gugur akibat pandemi COVID-19. Total dokter yang meninggal akibat pandemi yang disebabkan virus Corona menjadi 130 orang. \"Berita duka kembali datang dari dunia medis. Dalam tiga hari awal Oktober 2020 ini bertambah tiga dokter meninggal dunia akibat COVID-19, \" kata External PR Lead untuk Tim Mitigasi PB IDI, Elizabeth, seperti dilansir Antara, Minggu (4/10/2020).\r\n', 'https://news.detik.com/berita/d-5199314/pb-idi-3-dokter-kembali-gugur-akibat-covid-19'),
(7, 'Dituding_Covid-kan_Pasien,_Ini_Respons_Asosiasi_Rumah_Sakit', 'Dituding Covid-kan Pasien, Ini Respons Asosiasi Rumah Sakit', '\r\nDua asosiasi berkaitan dengan rumah sakit memberikan klarifikasi terkait dengan kembali maraknya pemberitaan yang menggiring persepsi dan opini publik seolah-olah rumah sakit (RS) \"meng-covid-kan\" pasien. Keduanya yakni Perhimpunan Rumah Sakit Seluruh Indonesia (Persi) dan Asosiasi Rumah Sakit Swasta Indonesia (ARSSI). Kuntjoro Adi PUrjanto, Ketua Umum Persi, menegaskan adanya pernyataan atau tanggapan yang tak disertai fakta, bukti atau tidak terbukti kebenarannya dalam membangun persepsi keliru atau menggiring opini seolah-olah rumah sakit melakukan perilaku yang tidak sesuai dengan ketentuan atau kecurangan/fraud adalah tidak benar. \"Persepsi keliru dan opini ini menghasilkan misinformasi dan disinformasi yang merugikan pelayanan rumah sakit dalam penanganan pandemi Covid-19,\" tegasnya, dalam siaran pers, dikutip CNBC Indonesia, Minggu (4/10/2020). Dia menegaskan, terbangunnya opini \"rumah sakit meng-covid-kan pasien\" menimbulkan stigma dan pengaruh luar biasa pada menurunnya kepercayaan publik terhadap rumah sakit. Opini yang salah tersebut juga meruntuhkan semangat dan ketulusan pelayanan yang dilaksanakan rumah sakit dan tenaga kesehatan. Hal ini dikhawatirkan dapat menimbulkan dampak negatif dalam pelayanan kesehatan yang dilakukan oleh rumah sakit kepada pasien dan masyarakat umum.\r\n', 'https://www.cnbcindonesia.com/news/20201004210558-4-191807/dituding-covid-kan-pasien-ini-respons-asosiasi-rumah-sakit'),
(8, 'Pemerintah_Tetapkan_Batas_Tertinggi_Biaya_Pemeriksaan_Swab_Mandiri_Rp._900.000', 'Pemerintah Tetapkan Batas Tertinggi Biaya Pemeriksaan Swab Mandiri Rp. 900.000', '\r\nPlt. Dirjen Pelayanan Kesehatan Prof. Dr. H. Abdul Kadir, PHD, Sp.THT-KL (K), MARS menegaskan bahwa penetapan batas tertinggi biaya pengambilan swab dan pemeriksaan RT-PCR merupakan jawaban pemerintah atas disparitas harga pemeriksaan swab di fasilitas pelayanan kesehatan. Penentuan batasan tarif ini mempertimbangkan kepentingan masyarakat dan fasilitas pelayanan kesehatan sebagai penyelenggara. â€œPersoalan kita adalah adanya disparitas harga, adanya harga yang tidak seragam terkait dengan harga pemeriksaan yang ada. Untuk itulah penetapan batas tertinggi biaya pengambilan swab dan pemeriksaan RT-PCR mandiriâ€ tegas Prof Kadir Penetapan biaya pengambilan swab dan pemeriksaan RT-PCR melalui pembahasan bersama antara Kementerian Kesehatan dengan BPKP berdasarkan hasil survey dan analisa pada fasilitas pelayanan kesehatan. Untuk itu tim BPKP dan tim Kementerian Kesehatan menyetujui batas tertinggi biaya pengambilan swab dan pemeriksaan RT-PCR mandiri yang bisa dipertanggungjawabkan untuk ditetapkan di masyarakat yaitu sebesar Rp. 900.000 Adapun batasan tarif ini akan berlaku setelah diterbitkan Surat Edaran Menteri Kesehatan setelah sosialisasi hari ini antara BPKP dan Kemenkes. â€œtarif diberlakukan setelah diterbitkannya surat edaran Menteri Kesehatanâ€ tambah Prof Kadir Sebagai acuan, komponen biaya terdiri atas jasa layanan SDM yang Terdiri atas Dokter Spesialis Mikrobiologi Klinik/Patologi Klinik, Tenaga ekstraksi, tenaga pengambilan sampel dan ATLM; bahan habis Pakai termasuk di dalamnya APD level 3; reagen untuk ekstraksi dan PCR; serta overhead mulai dari pemakaian listrik hingga pengelolaan limbah. Senada dengan kementerian Kesehatan, Deputi Kepala BPKP Bidang Pengawasan Instansi Pemerintah Bidang Polhukam PMK, Iwan Taufiq Purwanto, S.E., MBA menyatakan bahwa penetapan batasan ini untuk memberi kepastian kepada masyarakat dan BPKP siap mengawal dalam proses implementasinya â€œKami berkomitmen untuk memberikan pelayanan terbaik bagi masyarakat melalui pemberian kepastian bagi masyarakat yang ingin melaksanakan swab test mandiri.â€ jelas Iwan Kementerian Kesehatan meminta peran aktif Dinas Kesehatan dalam melakukan proses pengawasan dalam pemberlakuan harga pengambilan swab di fasilitas pelayanan kesehatan. â€œKami meminta kepada semua dinas kesehatan provinsi/kabupaten/kota melakukan pengawasan terhadap fasilitas pelayanan kesehatan dalam pemberlakuan harga pengambilan swab dan pemeriksaan RT-PCR, â€œ terang Prof Kadir Sebagai tindak lanjut, saat ini sedang berproses penyusunan Surat Edaran dimaksud Berita ini disiarkan oleh Biro Komunikasi dan Pelayanan Masyarakat, Kementerian Kesehatan RI. Untuk informasi lebih lanjut dapat menghubungi nomor hotline Halo Kemenkes melalui nomor hotline 1500-567, SMS 081281562620, faksimili (021) 5223002, 52921669, dan alamat email kontak@kemkes.go.id (PRU/NI) Kepala Biro Komunikasi dan Pelayanan Masyarakat drg. Widyawati, MKM\r\n', 'https://covid19.go.id/p/berita/pemerintah-tetapkan-batas-tertinggi-biaya-pemeriksaan-swab-mandiri-rp-900000'),
(9, 'Vaksin_Bermanfaat_Besar_Lindungi_Masyarakat', 'Vaksin Bermanfaat Besar Lindungi Masyarakat', '\r\nJAKARTA â€“ Masyarakat tidak perlu takut melakukan vaksinani, karena vaksinasi atau imunisasi telah dikenal sejak abad ke-18 di dunia dan telah terbukti mampu serta memiliki tingkat keberhasilan yang tinggi dalam melindungi manusia, dengan memberikan kekebalan tubuh dari berbagai macam penyakit. Di Indonesia, salah satu contoh keberhasilan vaksin adalah pencegahan penularan penyakit cacar di era 1980an. Direktur Surveilans dan Karantina Kesehatan Ditjen P2P Kementerian Kesehatan drg R Vensya Sitohang M Epid menyatakan, â€Jangan takut imunisasi, karena kualitas terjaga dan tentunya dari mulai registrasi hingga pembuatan terjaga. Dikawal juga oleh WHO (badan kesehatan dunia) dan tentunya pelaksanaan di Indonesia juga dikawal Badan Pengawasan Obat dan Makanan (BPOM)â€. Ini disampaikannya saat menjadi pembicara dalam dialog \"Vaksin : Melindungi Diri, Melindungi Negeri\" yang diselenggarakan di Media Center Komite Penanganan COVID-19 dan Pemulihan Ekonomi Nasional (KPCPEN), dan disiarkan melalui kanal YouTube FMB9, Kamis (1/10/20). Berbagai macam penyakit telah tersedia vaksinnya, mulai dari cacar, polio, TBC, pneumonia, tetanus, campak, rubella, Hepatitis B, difteri, japanese enchephalitis, pertusis, dan terbaru kanker mulut rahim. Termasuk tetanus ibu melahirkan dan bagi baru lahir yang sudah berhasil dihilangkan pada 2016 lalu. Juga ada penyakit maternal dan neonatal. \"Pengembangan vaksinasi ini tidak pernah berhenti. Oleh karena itu dukungan dari semua pihak sangat dibutuhkan, agar semua yang menjadi sasaran imunisasi, bisa mendapatkan haknya dan mendapatkan imunisasi agar terhindar dari penyakit yang dapat di cegah melalui imunisasi,\" lanjutnya. Untuk mengatur penyediaan vaksin pemerintah sudah menyiapkan UU No. 36 Tahun 2009 tentang Kesehatan dimana mengatur setiap anak berhak mendapatkan imunisasi dasar sesuai ketentuan untuk mencegah terjadi penyakit yang dihindari melalui imunisasi. Melalui Permenkes No. 12 Tahun 2017 pemerintah akan menyediakan dan mendistribusikan semua logistik yang berhubungan dengan imunisasinya mulai vaksinnya, alat suntiknya, safety box dan sebagainya. Khusus vaksin COVID-19 sejauh ini pemerintah menyiapkan roadmap agar vaksin tersedia tepat waktu. â€œUntuk jangka pendek Pemerintah telah melakukan diplomasi dengan berbagai pihak dalam penyediaan vaksin., sementara jangka panjang dilakukan pengembangan vaksin Merah Putih, produksi dalam negeri,\" jelas Vensya. Terkait vaksinasi pada anak, Ketua Bidang Humas dan Kesejahteraan Anggota Ikatan Dokter Anak Indonesia (IDAI) Dr Hartono Gunadi menyatakan,â€Perlu edukasi para orang tua agar memiliki pemahaman terhadap imunisasi, tanpa takut anaknya akan tertular penyakit-penyakit infeksi berbahaya yang harusnya bisa dicegah dengan imunisasi. Orang tua perlu paham, menerima dan mempunyai sikap yang baik terhadap imunisasi,\". Salah satu pemahaman yang salah adalah demam yang timbul setelah seorang anak yang sehat diimunisasi. Sehingga berkembang anggapan bahwa imunisasi itu berbahaya. Padahal hanya 1 persen dari 100 persen jumlah anak yang diimunisasi yang kemungkinan menderita demam \"Efek sampingnya itu sangat ringan bersifat sementara dan dapat hilang dengan pengobatan sederhana dibandingkan komplikasi yang dapat ditimbulkan bila anak tidak mempunyai kekebalan,\" terang Hartono. Sebagai contoh imunisasi pentavalen yang tidak diberikan, maka seorang anak bisa kena difteri, tetanus, batuk 100 hari termasuk radang paru-paru yang menjadi penyebab kematian nomor satu pada anak dibawah 5 tahun. Untuk efek samping vaksin atau yang dikenal dengan kejadian ikutan paska imunisasi (KIPI), terbagi dua. Ada yang KIPI umum atau sistemik seperti demam, nafsu makan menurun, lemas atau rewel yang paling sering. Itu dikatakannya hanya bersifat sementara dan hilang dalam 1 atau 2 hari. Lalu ada lagi KIPI lokal seperti bekas suntik akan menyebabkan pegal, bengkak atau kemerahan yang akan hilang hanya dalam beberapa hari kedepan. Ia meminta para orang tua tidak panik dan takut untuk imunisasi. Pada forum dialog tersebut, Communication for Development Specialist Unicef Indonesia Rizky Ika Syafitri menyatakan,â€Indonesia sendiri sudah 30 tahun lebih melaksanakan program imunisasi. Di dunia bahkan sudah lebih lama lagi dan terbukti vaksin menyelamatkan jutaan anak dari kematian, kesakitan dan kecacatan\". Rizky menuturkan dalam memberikan imunisasi terhadap masyarakat banyak tantangan yang dihadapi. Seperti ada masyarakat yang tidak tahu bahwa imunisasi itu penting. Lalu banyak sekali berita bohong atau hoax terkait imunisasi. \"Pemerintah bersama Unicef dan lembaga lainnya berusaha menjawab berbagai misinformasi dan berita bohong terkait imunisasi,\" ujar Rizky.\r\n', 'https://covid19.go.id/p/berita/vaksin-bermanfaat-besar-lindungi-masyarakat'),
(10, 'Dukungan_Keluarga_Menjaga_Imunitas_Pasien_Positif_Covid-19', 'Dukungan Keluarga Menjaga Imunitas Pasien Positif Covid-19', '\r\nGraha BNPB Jakarta 2 Oktober 2020 - Penderita positif Covid-19 bergejala ringan, sedang, dan tanpa gejala (OTG) perlu mendapatkan informasi positif guna meningkatkan imunitas tubuhnya. Psikolog Muhammad Chalid, S.Psi, MM mengatakan pasien Covid-19 harus mendapatkan dukungan penuh dari keluarga dan lingkungan. Mereka perlu mendapatkan informasi positif tentang virus corona dan kesembuhannya. \"Memang banyak sekali pasien yang imunitas dan mentalnya turun setelah mengetahui dirinya positif Covid-19. Seharusnya mereka diberi penguatan dengan menceritakan hal-hal positif seperti banyak pasien positif Covid-19 yang sembuh,\" papar Muhammad Chalid dalam talkshow bertema \"Tetap Aman dan Imun di Tengah Pandemi Covid-19\" di Media Center Satuan Tugas Penanganan Covid-19 Graha BNPB Jakarta pada Jumat (2/10) siang. Dukungan psikologis dari keluarga, lanjut Chalid, dibutuhkan untuk menjaga imunitas tubuh. Keluarga bisa menguatkan mental dengan mengirimkan doa atau informasi-informasi positif. Terkait menjaga pikiran tetap positif Chalid mengatakan masyarakat perlu diberikan pemahaman bahwa Covid-19 ini terjadi di seluruh dunia dan semua penyakit itu pasti ada obatnya. \"Setelah lebih enam bulan otomatis kita sudah mulai bisa menyesuaikan diri dengan pandemi ini. Kita harus berpikiran positif bahwa setiap penyakit ada obatnya dan setiap pandemi ada akhirnya,\" tambah Chalid. Sekretaris Tim Mitigasi Dokter dalam Pandemi Covid-19 Pengurus Besar Ikatan Dokter Indonesia (PB IDI) dr. Ekasakti Ochtohariyanto, MPdKed mengatakan imunitas tubuh itu sudah ada di dalam tubuh kita. Tanpa konsumsi vitamin pun sudah bagus. Konsumsi makanan sehat, olahraga tiga kali dalam seminggu minimal 30 menit per hari, dan berpikiran positif bisa meningkatkan imunitas. Kepala Puskesmas Cempaka Baru Kemayoran Jakarta itu mengingatkan kurangi konsumsi gula dan protein. \"Pandemi masih panjang. Kita perlu maksimalkan kondisi tubuh kita. Kalau tidak menjaga diri dengan menerapkan protokol kesehatan kemungkinan besar kita bisa masuk ke rumah sakit,\" jelas dr. Eka. Ia menjelaskan pasien dengan pengorbit yang memiliki penyakit penyerta harus ekstra hati-hati. Terutama yang memiliki riwayat penyakit gula sehingga perlu melakukan olahraga teratur dengan intensitas ringan. \"Pada dasarnya orang dengan pengorbit yang kondisi biasa bisa jadi lebih berat dan yang tidak punya pengorbit juga bisa saja meninggal,\" ungkap dr. Eka yang masih melihat ada masyarakat yang lalai memakai masker padahal memakai masker itu sangat penting untuk mencegah penularan Covid-19. (STPC19/AHM/MJS)\r\n', 'https://covid19.go.id/p/berita/dukungan-keluarga-menjaga-imunitas-pasien-positif-covid-19'),
(11, 'Masyarakat_Perlu_Membuat_Zonasi_di_Rumah_Masing-Masing', 'Masyarakat Perlu Membuat Zonasi di Rumah Masing-Masing', '\r\nGraha BNPB Jakarta 1 Oktober 2020 - COVID-19 itu bukan kutukan tapi sama seperti penyakit lainnya. Hal itu ditekankan oleh Tim Pakar Satuan Tugas Penanganan COVID-19 (Satgas COVID-19) Dr. Turro Wongkare dalam talkshow bertema \"Pencegahan COVID-19: Beda Masyarakat, Beda Startegi?â€ di Media Center Satgas COVID-19 Graha BNPB Jakarta pada Kamis (1/10) siang. Turro menyebutkan penderita COVID-19 sama seperti orang mengindap penyakit TBC yang menggunakan masker dan membutuhkan dukungan dari keluarga dan lingkungan. \"COVID-19 itu bukan kutukan. COVID-19 penyakit biasa yang menular sama dengan TBC, cacar, dan flu. Hanya ini mematikan kalau tidak ikuti protokol bisa terpapar,\" ujar Turro. Turro menegaskan kembali orang yang terpapar positif COVID-19 bukan berarti akhir dari perjalanan hidup. Namun sama halnya dengan penderita TBC yang berpotensi sembuh. Masyarakat, kata Turro, harus tetap beraktivitas berdampingan dengan COVID-19, baik yang sudah terpapar ataupun belum. Tentu saja dengan mengubah kebiasaan hidup secara keseluruhan dan patuh pada protokol kesehatan. Bukan hanya sekadar mencuci tangan, tapi bekerja dan beraktivitas dari rumah. \"Ini sesuatu yang biasa, mengubah hidup secara keseluruhan. Ini (COVID-19) sama dengan penyakit lainnya. Jangan dijauhi, apalagi sampai dikucilkan,\" ujarnya. Turro juga menyoroti hasil survei BPS pertengahan September 2020 lalu yang menyebut 7 persen masyarakat memberikan stigma pada penderita COVID-19. \"Harus ada keseimbangan dalam menyampaikan informasi tanpa menakut-nakuti,\" ujarnya. Dr (DMB) dr Norman Zainal, SpOt mengatakan pemakaian masker menjadi alat mencegah penularan atau tertular virus corona. Masker secara ilmiah diyakini mencegah penularan melalui droplet. Pemerintah memproduksi masker agar harganya terjangkau bagi masyarakat. Selain menggunakan masker, masyarakat perlu membuat zonasi di rumahnya masing-masing agar steril. Misalnya, di halaman depan itu zona merah tempat menyimpan sepatu, sandal. Ruang tamu itu zona kuning, dan kamar tidur zona hijau. \"Zona hijau dan kuning itu harus dipertahankan dan dibersihkan menggunakan cairan sehingga bisa mengusir kuman,\" ujarnya. Norman menyebutkan sosialisasi patuh protokol kesehatan perlu sarana pendukung untuk mempermudah. Sebagai contoh, â€œSiapkan keran atau ember mencuci tangan di setiap rumah guna mempermudah,\" ujarnya.\r\n', 'https://covid19.go.id/p/berita/masyarakat-perlu-membuat-zonasi-di-rumah-masing-masing'),
(12, 'WHO_Beri_Rekomendasi_Untuk_Indonesia_Menyelenggarakan_Rapid_Test_Antigen', 'WHO Beri Rekomendasi Untuk Indonesia Menyelenggarakan Rapid Test Antigen', '\r\nJAKARTA - Badan Kesehatan Dunia atau World Health Organization (WHO) telah mengumumkan akan menyediakan 120 juta test cepat atau rapid test antigen Covid-19 untuk 133 negara. WHO memprioritaskan negara-negara yang berpendapatan rendah dan menengah yang memiliki kasus dalam jumlah besar. Juru Bicara Satgas Penanganan Covid-19 Prof Wiku Adisasmito mengabarkan pihaknya telah berkomunikasi dengan WHO melalui perwakilan yang ada di Indonesia. Dan mengusulkan agar Indonesia juga dapat dipertimbangkan sebagai negara prioritas penerima. \"Kami mohon untuk bisa dipertimbangkan mendapatkan bantuan dari WHO untuk tes cepat ini. Agar kita bisa mendeteksi lebih cepat kasus Covid-19 yang ada di tengah-tengah masyarakat,\" ungkap Juru Bicara Satgas Penanganan Covid-19 Prof. Wiku Adisasmito, menjawab pertanyaan media dalam jumpa pers di Kantor Presiden, Kamis (1/10/2020). Indonesia kata Wiku, sudah mendapatkan rekomendasi dari WHO untuk menyelenggarakan tes cepat Covid-19 yang kualitasnya baik. Dan saat ini sedang dikaji untuk selanjutnya akan digunakan dengan akurasi yang lebih tinggi. \"Karena ini mendeteksi antigen, tentunya akan lebih baik dibandingkan mendeteksi antibodi dalam rangka proses svreening sebelum dilakukan tes penegakan diagnosa dengan realtime PCR,\" jelasnya. Lalu untuk alat transportasi pasien Covid-19 menuju rumah sakit atau puskesmas, pemerintah telah menyiapkan mobil ambulan yang khusus mengangkut pasien dari rumah dan dari kediaman untuk ke rumah sakit. Agar mendapatkan perawatan di rumah sakit. \"Jadi silahkan menghubungi rumah sakit terdekat agar bisa dilakukan penjemputan dan dirawat dengan baik tanpa memberikan risiko kepada orang lain dengan kendaraan yang mungkin tidak standar membawa pasien gejala Covid-19,\" saran Wiku. Disamping itu, Wiku juga menanggapi pertanyaan media soal mundurnya Kepala Bidang Penanganan Kesehatan Satgas Covid-19 Prof. Akmal Taher. Menurut Wiku Akmal Taher sudah lama bergabung dalam menangani pandemi Covid-19 sejak masa awal. Akmal Taher adalah anggota tim pakar dan bertugas mengkoordinir pakar bidang medis. \"Banyak sekali kontribusi beliau dengan para pakar di bidang medis. Untuk membuat guidelines (panduan), bahan untuk surat edaran penanganan pasien Covid-19. Dan sampai sekarang beliau tetap bergabung dengan Satgas dalam fungsi support khususnya dalam konteksnya dalam kebutuhan pakar,\" tutup Wiku. Jakarta, 1 Oktober 2020 Tim Komunikasi Komite Penanganan Corona Virus Disease 2019 (Covid-19) dan Pemulihan Ekonomi Nasional\r\n', 'https://covid19.go.id/p/berita/who-beri-rekomendasi-untuk-indonesia-menyelenggarakan-rapid-test-antigen'),
(13, 'Penanganan_Covid-19_Pada_10_Provinsi_Prioritas_Cenderung_Membaik', 'Penanganan Covid-19 Pada 10 Provinsi Prioritas Cenderung Membaik', '\r\nJAKARTA - Perkembangan penanganan pada 10 provinsi prioritas menunjukkan kondisi yang positif. Persentase angka kesembuhan terlihat meningkat, pertambahan kasus terkonfirmasi positif Covid-19 menurun serta kasus kematian juga cenderung menurun. Hasil evaluasi periode 13 - 27 September 2020, Satgas Penanganan Covid-19 menguraikan konstribusi kasus secara nasional pada 10 provinsi prioritas. Kesepuluh itu diantaranya DKI Jakarta, Jawa Barat, Jawa Tengah, Jawa Timur, Kalimantan Selatan, Sulawesi Selatan, Sumatera Utara, Papua, Bali dan Banten. Kontribusi 10 provinsi prioritas terhadap nasional, Per 13 September persentase kasus aktif menyumbang 71,86% dari kasus nasional. Kemudian pada 20 September persentase menurun menjadi 70,41% dan pada 27 September turun menjadi 67,62%. \"Ini adalah kabar baik dan perlu ditekan sehingga kasus aktif di 10 provinsi prioritas dapat terus menurun,\" ungkap Juru Bicara Satgas Penanganan Covid-19 Prof. Wiku Adisasmito, dalam jumpa pers di Kantor Presiden yang disiarkan kanal YouTube Sekretariat Presiden, Kamis (1/10/2020). Dilihat kasus sembuhnya, terjadi peningkatan baik tingkat nasional maupun 10 provinsi prioritas. Namun diakuinya, konstribusi kesembuhan 10 provinsi prioritas terhadap kesembuhan nasional mengalami penurunan. Per 13 September persentase kesembuhan 80,15%, lalu per 20 September menurun menjadi 79,65% dan 27 September menurun lagi menjadi 79,35%. \"Kalau kita meningkatkan kesembuhan pada 10 provinsi prioritas ini, maka angka nasional juga akan meningkat secara signifikan,\" ujar Wiku. Sedangkan pada kasus kematian terjadi peningkatan pada tingkat nasional maupun 10 provinsi prioritas ini. Persentasenya cenderung meningkat. Kontribusi nya terhadap nasional Per 13 September, 77,67%, per 20 September 80,47% dan 27 September 80,18%. Ia pun merincikan kasus yang ada pada 10 provinsi prioritas perkembangan kasusnya berbeda-beda. Secara umum persentase kasus aktif menurun, kecuali Sulawesi Selatan dan Papua. Sulawesi Selatan sempat mengalami peningkatan persentase kasus aktif pada 20 September sebesar 23,90% dari 20,77% per 13 September. Dan pada 27 September 23,23%. Sedangkan Papua kasus aktifnya meningkat cukup signifikan, yaitu per 13 September berada di 22,72% naik menjadi 29,5% pada 20 September dan naik lagi menjadi 35,7% pada 27 September. \"Hal ini perlu menjadi perhatian bagi pemerintah daerah untuk terus menekan penularan sehingga dapat menurunkan kasus aktifnya,\" lanjut Wiku. Pada kesembuhan cenderung meningkat di seluruh provinsi prioritas, namun di Sulawesi Selatan dan Papua menurun. Sulawesi Selatan menurun dari 76,37% per 13 September, menjadi 74,06% pada 27 September. Papua menurun dari 76,01% per 13 September menjadi 62,8% pada 27 September. Untuk kasus kematian cenderung mengalami stagnan bahkan terjadi peningkatan pada sejumlah provinsi prioritas. Untuk DKI Jakarta, Jawa Barat, Jawa Tengah, Kalimantan Selatan dan Sulawesi Selatan mengalami penurunan. \"Kami mohon 10 provinsi ini, tentunya seluruh provinsi di Indonesia untuk terus menekan angka kematian dengan meningkatkan kualitas pelayanan kesehatan penanganan kasus terutama pada geja sedang dan berat, sehingga angka kematian dapat ditekan menjadi tidak ada penambahan sama sekali,\" lanjut Wiku. Selain itu perkembangan secara nasional dalam sepekan terakhir, terdapat 20 provinsi dengan jumlah kasus yang meningkat dibanding minggu sebelumnya. Ada 14 provinsi dengan kasus menurun dibandingkan Minggu sebelumnya. Sampai dengan 27 September, provinsi dengan peningkatan kasus paling tinggi ialah Jawa Barat dengan penambahan 1.726 kasus, disusul DKI Jakarta dengan penambahan kasus sebanyak 1.002 kasus. Dan Kalimantan Timur dengan penambahan 584 kasus. Untuk provinsi dengan penambahan kasus terendah dalam satu Minggu terakhir ialah Nusa Tenggara Barat dengan 2 kasus, Sulawesi Tengah 6 kasus dan Kalimantan Selatan 9 kasus. \"Kami mohon agar dapat ditekan sedikit lagi agar minggu depan tidak terjadi penambahan kasus sama sekali,\" ujarnya. Apresiasi diberikan pada 14 provinsi dengan penurunan kasus dalam seminggu terakhir paling tinggi di Jawa Timur 445 kasus, Sumatera Utara 233 kasus, dan Aceh 205 kasus. Sementara perkembangan harian per 1 Oktober 2020 terjadi penambahan kasus positif 4.174 kasus dan kumulatifnya 291.182 kasus. Kasus aktif hari ini sebanyak 61.839 kasus atau 21,2%, dibandingkan rata-rata dunia 22,5%. Jumlah kasus sembuh ada penambahan 3.540 kasus dan kumulatifnya 218.487 kasus atau 75%. Rata-rata kesembuhan dunia di angka 74,44%. \"Jadi persentase kesembuhan di Indonesia sedikit lebih tinggi dari angka dunia,\" ujarnya. Pada kasus kematian hingga saat ini sudah mencapai 10.856 kasus atau 3,7%. Dibandingkan persentase rata-rata kematian di dunia sebesar 2,98%. \"Kasus meninggal persentasenya di Indonesia makin lama makin turun tetapi sementara waktu masih diatas rata-rata angka dunia,\" ungkapnya. Per hari ini jumlah suspek tercatat ada 135.480 kasus dan 43.592 spesimen. Sebaran wilayah masih terjadi di 34 provinsi dan 497 kabupaten/kota. Jakarta, 1 Oktober 2020 Tim Komunikasi Komite Penanganan Corona Virus Disease 2019 (Covid-19) dan Pemulihan Ekonomi Nasional\r\n', 'https://covid19.go.id/p/berita/penanganan-covid-19-pada-10-provinsi-prioritas-cenderung-membaik'),
(14, 'Tetap_Cek_ke_Dokter_Saat_Pandemi_Bila_Alami_Masalah_Kesehatan', 'Tetap Cek ke Dokter Saat Pandemi Bila Alami Masalah Kesehatan', '\r\nGraha BNPB Jakarta 30 September 2020 - Ibu hamil positif Covid-19 sebaiknya mematuhi protokol kesehatan serta menginformasikan statusnya pada dokter kandungan. Dalam talkshow bertema \"Para Pahlawan Kesehatan di Pusaran Pandemi\" di Media Center Satuan Tugas Penanganan Covid-19 (Satgas Covid-19) Graha BNPB Jakarta pada Rabu (30/9) siang, dr. Muhammad Fadli, Sp.OG mengatakan ibu hamil yang positif Covid-19 disarankan banyak mengkonsumsi vitamin untuk meningkatkan imunitas tubuhnya. \"Ibu hamil yang positif Covid-19 itu harus banyak mengkonsumsi vitamin C, guna meningkatkan imunitas tubuhnya,\" ujarnya. dr. Fadli mengatakan ibu hamil positif Covid-19 tanpa gejala alias OTG sebaiknya melakukan isolasi mandiri dan berkonsultasi dengan dokter kandungannya. Dalam konsultasi nantinya, kata Fadli, dokter akan memberikan nasehat mengkonsumsi multivitamin. \"Kalau ada gejala berat, misalnya batuk, sebaiknya datang ke rumah sakit untuk segera mendapat tindakan,\" ujarnya. Di tengah paparannya Fadli mengungkapkan kasus ibu hamil positif Covid-19 menularkan virus corona pada janin dalam kandungan. Salah satu pasiennya mendapat kabar positif Covid-19, dua hari kemudian keluar hasil swab test ternyata negatif. \"Dan USG saat itu menemukan detak jantung bayi sudah tidak ada. Apakah ini karena covid itu masih dalam penelitian. Tapi dari beberapa penelitian virus ini bisa masuk ke jalan plasentanya,\" ujarnya. drg. R. Ngt. Anastasia Ririen Pramudyawati mengatakan selama pandemi jangan meremehkan kasus bau mulut dan gusi berdarah. \"Bau mulut dan gusi berdarah, jangan dianggap biasa saja. Itu kalau dibiarkan bisa berdampak hancurnya penyangga gigi,\" kata Dokter Anna, panggilan drg. R. Ngt. Anastasia Ririen Pramudyawati. Ia menyarankan agar masyarakat tak perlu takut untuk datang ke rumah sakit, klinik, atau dokter gigi guna memeriksakan kesehatan gigi dan mulut. Karena dokter yang praktek menggunakan alat pelindung diri (APD) dan menerapkan protokol kesehatan. (STPC19/AHM/MJS)\r\n', 'https://covid19.go.id/p/berita/tetap-cek-ke-dokter-saat-pandemi-bila-alami-masalah-kesehatan'),
(15, 'Hasil_Survei_BPS:_92_Persen_Warga_Patuh_Pakai_Masker_Selama_Pandemi_COVID-19', 'Hasil Survei BPS: 92 Persen Warga Patuh Pakai Masker Selama Pandemi COVID-19', '\r\nGraha BNPB Jakarta 28 September 2020 - Ketua Satuan Tugas Penanganan COVID-19 (Satgas COVID-19) Doni Monardo mengatakan seluruh masyarakat perlu bergerak bersama-sama dalam penanganan COVID-19, baik di tingkat pusat maupun daerah. Dalam talkshow bertema \"Rilis Hasil Survei Perilaku Masyarakat di Masa Pandemi COVID-19\" di Media Center Satgas COVID-19 Graha BNPB Jakarta pada hari Senin (28/9) siang Doni Monardo menyoroti hasil survei BPS yang menunjukkan 17 persen responden menyangka tidak mungkin tertular. Survei ini dilakukan oleh BPS dari tanggal 7 September - 14 September 2020 secara daring dengan jumlah responden 90.967 responden. Doni menyebutkan temuan survey 17 persen responden tidak yakin terpapar COVID-19 itu merupakan angka yang cukup besar jika dikalikan jumlah penduduk Indonesia. Padahal semua tahu statusnya pandemi. Jadi tidak ada satu jengkal tanah (tempat) pun di Indonesia yang aman dan bebas dari COVID-19. \"Masalahnya media pengantarnya manusia. Kalau manusia sudah dirawat di rumah sakit kita bisa menghindari. Masalahnya sebagai OTG yang karier itu cepat atau lambat pasti tertular,\" ujar Doni Monardo. Kepala Badan Nasional Penanggulangan Bencana (BNPB) ini juga menyoroti penanganan penularan COVID-19 ke pejabat. Ia menyebut Kementerian Pemberdayaan Aparatur Negara dan Reformasi telah mengeluarkan surat edaran tentang ketentuan ASN untuk zona merah diperbolehkan bekerja 25 persen, zona orange 50 persen, kuning 75 persen, dan tidak ada terdampak 100 persen. \"Ini langkah baik pemerintah. Mudah-mudahan dengan kebijakan ini bisa mengurangi klaster perkantoran,\" ujarnya. Kepala Badan Pusat Statistik (BPS) Suhariyanto mengatakan temuan survei BPS terhadap perilaku masyarakat di masa pandemi untuk tingkat kepatuhan dalam menggunakan masker mencapai 92 persen. Kepatuhan masyarakat mencuci tangan dan jaga jarak itu 75 persen. Secara umum Suhariyanto menyatakan temuan ini menggembirakan. Tapi perlu memperhatikan aspek cuci tangan dan jaga jarak. Tiga komponen ini berjalan pararel. \"April lalu presentasi penggunaan masker naik 8 persen. Sementara cuci tangan dan jaga jarak mengalami penurunan. Ke depan kita perlu mensosialisasikan kampanye cuci tangan dan jaga jarak ke masyarakat lebih masif,â€ papar Suhariyanto yang sudah empat tahun jadi Kepala BPS. Suhariyanto memunculkan tiga persentase tertinggi responden tak patuh protokol kesehatan. Pertama, 55 persen karena tidak ada sanksi tegas dan tidak ada yang terkena COVID-19 di sekitarnya. Kedua, 33 persen responden menyebut tidak patuh karena mengganggu pekerjaan. Dan ketiga, 19 persen tak patuh dengan alasan aparat dan pimpinan tidak memberikan contoh. \"Makanya ke depan jajaran pimpinan harus mematuhi dan memberikan contoh dalam menegakkan protokol kesehatan,\" ujarnya. Soal keteladanan, Doni mengingatkan agar semua pihak saling mengingatkan termasuk pada orang yang statusnya lebih tinggi. \"Harus berani mengingatkan walaupun kalimat itu kurang menyenangkan. Tapi demi kebaikan harus banyak orang yang mengingatkan,\" ujarnya.\r\n', 'https://covid19.go.id/p/berita/hasil-survei-bps-92-persen-warga-patuh-pakai-masker-selama-pandemi-covid-19'),
(16, 'Kabupaten_Ngada_Contoh_Penyelenggaraan_Pilkada_Yang_Aman_Dari_Covid-19', 'Kabupaten Ngada Contoh Penyelenggaraan Pilkada Yang Aman Dari Covid-19', '\r\nJAKARTA - Meski sudah diingatkan berkali-kali, namun Satgas Penanganan Covid-19 masih menemukan pasangan calon (Paslon) peserta Pemilihan Kepala Daerah (Pilkada) Tahun 2020 yang mengundang kerumunan dan tidak mematuhi protokol kesehatan. \"Satgas Penanganan Covid-19 prihatin dan kecewa. Kami berharap bahwa temuan ini adalah yang terakhir. Maka kasus ini dapat menjadi perhatian dan pelajaran bagi Paslon agar betul-betul patuh pada protokol kesehatan. Mari kita selamatkan diri anda dan pemilih anda,\" ungkap Juru Bicara Satgas Penanganan Covid-19 Prof. Wiku Adisasmito dalam jumpa pers di Kantor Presiden yang disiarkan kanal YouTube Sekretariat Presiden, Selasa (29/9/2020). Padahal para Paslon harus menjadi contoh yang baik bagi pemilihnya di daerah dengan cara selalu mengedepankan protokol kesehatan. Hindari melakukan kegiatan yang dapat memicu timbulnya kerumunan. Satgas Penanganan Covid-19 kata Wiku mengapresiasi daerah-daerah dan partai politik yang telah membuat satuan khusus yang fokus dalam penegakan protokol kesehatan. Pihaknya berharap fungsi satuan khusus itu dapat efektif mendorong implementasi protokol kesehatan dalam setiap kegiatan tahapan Pilkada 2020. \"Salah satu contoh adalah Kabupaten Ngada di Nusa Tenggara Timur. Seluruh unsur yang terlibat dalam pilkada disana, dengan tegas menjaga agar protokol kesehatan dijalankan dengan ketat,\" Wiku menjelaskan. Cara yang dilakukan pemerintah setempat adalah mewajibkan para paslon mengucapkan ikrar pakta integritas penerapan protokol kesehatan pencegahan dan pengendalian Covid-19 selama pelaksanaan pilkada. \"Kami mohon daerah-daerah lainnya yang menyelenggarakan pilkada, agar dapat mencontoh dan melaksanakan kegiatan seperti ini, untuk bisa menjaga pilkada yang aman dari ancaman penularan Covid-19,\" lanjutnya. Pihaknya juga mendorong penyelenggara pilkada yaitu Komisi Pemilihan Umum (KPU) dan yang mengawasi yaitu Badan Pengawas Pemilu (Bawaslu) untuk melakukan monitoring dan penindakan bagi paslon yang mengabaikan dan melanggar protokol kesehatan dalam setiap kegiatan kampanye sesuai Peraturan KPU No. 13 Tahun 2020. Masyarakat pun dapat secara aktif mengawal pelaksanaan rangkaian pilkada dengan melaporkan semua pelanggaran ke Bawaslu setempat. \"Mari kita bersama-sama bahu membahu untuk mencapai pilkada yang aman dari Covid-19,\" pesan Wiku. Jakarta, 29 September 2020 Tim Komunikasi Komite Penanganan Corona Virus Disease 2019 (Covid-19) dan Pemulihan Ekonomi Nasional\r\n', 'https://covid19.go.id/p/berita/kabupaten-ngada-contoh-penyelenggaraan-pilkada-yang-aman-dari-covid-19'),
(17, 'Hindari_COVID-19,_Gaya_Hidup_Sehat_bagi_Obesitas', 'Hindari COVID-19, Gaya Hidup Sehat bagi Obesitas', '\r\nKetua Perhimpunan Dokter Spesialis Gizi Klinik Indonesia (PDGKI) Jawa Barat Dr. dr. Gaga Irawan Nugraha, Sp.GK, MGizi mengatakan saat awal Covid-19 meningkat mereka yang mengalami obesitas menjadi salah satu faktor risiko yang terkena. Dalam talkshow bertema \"Obesitas dan Risiko Covid-19\" di Media Center Satuan Tugas Penanganan Covid-19 (Satgas Covid-19) Graha BNPB Jakarta pada Selasa (29/9) sore, Dr. Gaga mengatakan setelah Covid-19 di Amerika Serikat pada bulan April 2020 melaporkan lebih dari 42 persen kasus kematian di Kota New York ternyata mereka yang mengalami obesitas. Kasus obesitas ini nomor dua setelah hipertensi. Kenapa? Obesitas itu memiliki lemak lebih besar pada permukaan sehingga reseptor menempel virus lebih luas. Dengan kondisi tersebut mereka yang mengalami obesitas lebih mudah kena Covid-19. \"Lemak tubuh mereka yang mengalami obesitas itu tersebar di mana-mana, jantung banyak lemak, juga perut. Sehingga ketika terinfeksi Covid-19 sulit bernafas akibatnya paru-paru lebih kecil karena jantung tertimbun lemak,\" ujar Dr. Gaga via aplikasi zoom. Dr. Gaga menjelaskan untuk menghindari terpapar Covid-19 mereka yang mengalami obesitas harus mengubah gaya hidup dan pola makan sehat. Hindari gula dalam bentuk makanan, permen, cokelat, kecuali pada bumbu masakan. Makanan manis pun perlu dihindari. Selain itu makanan terbuat dari tepung terigu, kanji, atau tepung beras pun sebaiknya dihindari. â€œSemua camilan sekarang terbuat dari tepung terigu. Itulah yang paling meningkatkan gula darah dan memudahkan obesitas,\" jelas Dr Gaga yang masih aktif menjadi dosen di Fakultas Kedokteran Universitas Padjadjaran Bandung. Dr. Gaga menjelaskan cara diet sehat bagi obesitas adalah dengan menjaga pola makan teratur tiga kali sehari. Dengan makan teratur tiga kali kebutuhan nutrisi utamanya terjaga, lebih dari 80 persen zat gizi yang diperlukan tubuh sudah terpenuhi. Dengan demikian terhindar mengkonsumsi camilan. \"Stop semua camilan yang mengandung gula dan tepung. Makan buah-buahan yang berair banyak,\" ujarnya. Wakil Ketua Bidang Apoteker Advance dan Spesialis PP Ikatan Apoteker Indonesia (IAI) Prof. Dr. Kerry Lestari Dandan, Apt, M.Si menggarisbawahi stop ngemil dan karbohidrat. Prof. Kerry menyebut kebijakan bekerja dari rumah terkadang lupa waktu di depan gadget. Sampai lupa olahraga dan banyak makan camilan. Sehingga berat badan bertambah karena akses makanan lebih dekat dan kurang aktivitas olahraga. Ia menyarankan bagi mereka yang mengalami obesitas untuk mengkonsumsi ramuan herbal sebagai pengganti camilan yang jauh lebih bermanfaat dibanding karbohidrat dan makanan olahan dari tepung. Seperti teh hijau yang punya kandungan anti oksidan tinggi sehingga bisa meningkatkan daya tahan tubuh dan mengendalikan obesitas. Atau stevia yang bisa mencegah peningkatan berat badan. \"Minum stevia rutin di pagi hari itu bagus dan berasa ada lemak di saluran pembuangan kita,\" papar Prof. Kerry yang aktif mempromosikan kekayaan herbal yang dimiliki Indonesia dan membantu para petani dan para pengusaha kecil dan menengah.\r\n', 'https://covid19.go.id/p/berita/hindari-covid-19-gaya-hidup-sehat-bagi-obesitas'),
(18, 'Upaya_Tracing_Membutuhkan_Sinergi_Masyakarat', 'Upaya Tracing Membutuhkan Sinergi Masyakarat', '\r\nJAKARTA - Sejauh ini pemerintah sudah cukup berhasil meningkatkan kapasitas testing (pemeriksaan) dan treatment (perawatan) pasien Covid-19. Meskipun secara nasional angka testing belum mencapai target Badan Kesehatan Dunia atau Wolrd Health Organization (WHO), sudah ada beberapa provinsi yang melampaui target ini. Selain itu angka kesembuhan juga meningkat dari waktu ke waktu yang mana ini menunjukkan treatment yang dilakukan berkontribusi terhadap naiknya angka kesembuhan pasien Covid-19. Meski demikian Juru Bicara Satgas Penanganan Covid-19 Prof. Wiku Adisasmito mengakui adanya kendala terbesar ialah tracing. Karena banyaknya resistensi dari masyarakat di lapangan akibat adanya stigma negatif dari masyarakat terhadap penderita Covid-19. Dan ini harus dihindari. Diperparah adanya berita bohong yang menghilangkan rasa percaya terhadap pasien yang menjadi subyek tracing. \"3T (testing, tracing dan treatment) merupakan upaya yang tidak mudah sehingga membutuhkan sinergi dari masyarakat. Untuk itu kami menghimbau masyarakat untuk betul-betul memahami bahwa keterbukaan kita semuanya sangat penting bagi pemerintah dalam upaya pemerintah melakukan tracing,\" imbau Wiku di Kantor Presiden, Selasa (29/9/2020). Masyarakat harus terbuka terkait riwayat perjalanan dan interaksi yang dilakukan. Masyarakat diminta tidak memberikan stigma negatif terhadap penderita positif Covid-19. Agar mereka yang terpapar dapat sembuh dan tidak menularkan kepada yang lainnya. \"Apa yang bisa dilakukan masyarakat, kita bisa bersama-sama memudarkan stigma negatif. Ingat musuh kita bukan saudara-saudara kita atau orangnya. Musuh kita adalah virusnya. Bersikap jujur dan suportif kepada petugas adalah sikap yang penting dalam mensukseskan program 3T,\" jelas Wiku. Tak lupa ia mengingatkan masyarakat agar bersama-sama menekan penularan dalam lingkungan klaster keluarga. Terapkan protokol kesehatan yang ketat terhadap sesama anggota keluarga dan lindungi anggota keluarga yang masuk kelompok rentan. Jakarta, 29 September 2020 Tim Komunikasi Komite Penanganan Corona Virus Disease 2019 (Covid-19) dan Pemulihan Ekonomi Nasional\r\n', 'https://covid19.go.id/p/berita/upaya-tracing-membutuhkan-sinergi-masyakarat'),
(19, 'Tingkat_Kesembuhan_Covid-19_Membaik_Pada_399_Kabupaten/Kota', 'Tingkat Kesembuhan Covid-19 Membaik Pada 399 Kabupaten/Kota', '\r\nJAKARTA - Persentase kesembuhan pasien Covid-19 di sebagian besar kabupaten/kota di Indonesia memiliki angka kesembuhan yang cukup baik. Juru Bicara Satgas Penanganan Covid-19 Prof. Wiku Adisasmito menyebut 77,6% atau 399 dari 514 kabupaten/kota memiliki tingkat kesembuhan antara 50 - 100%. \"Ini adalah hal yang baik yang perlu dipertahankan dan ditingkatkan agar kesembuhannya bisa mencapai 100%. Apabila penanganan kasusnya baik dan dini, maka potensi mendapatkan kesembuhan 100% sangat besar,\" ungkapnya dalam jumpa pers Perkembangan Penanganan Covid-19 di Kantor Presiden, Selasa (29/9/2020) yang disiarkan kanal YouTube Sekretariat Presiden. Meski demikian 19,3% atau sebanyak 99 kabupaten/kota yang memiliki persentase kesembuhan kurang dari 50%. Pemerintah daerah setempat diminta untuk dapat meningkatkan kesembuhan dan meningkatkan pelayanan kesehatan dan penanganan dini. Juga segera berkoodinasi dengan Kementerian Kesehatan dan Satgas Covid-19 agar bisa dibantu. Perkembangan kasus Covid-19 dalam satu pekan ini persentase kenaikannya mencapai 15,1%. Kenaikan kesembuhan tertinggi berada di Jawa Barat (767), Riau (625), Banten (573), Jawa Tengah (483) dan Sulawesi Selatan (379). Persentase kesembuhan tertinggi berada di Maluku Utara (87,94%), Kepulauan Bangka Belitung (86,35%), Gorontalo (86,20%), Kalimantan Selatan (84,27%) dan Jawa Timur (83,81%). \"Pada minggu ini Jawa Timur masuk dalam 5 besar peningkatan kesembuhan, dan ini perlu diapresiasi dan terus dijaga agar tetap tinggi angka kesembuhannya,\" harap Wiku. Untuk perkembangan kasus positif mingguan secara nasional terjadi kenaikan 16,4% dibandingkan pekan sebelumnya atau dari 26.314 menjadi 30.641. Ada 5 provinsi dengan kenaikan kasus tertinggi per 29 September 2020, yakni Jawa Barat (1.726), DKI Jakarta (1.002), Kalimantan Timur (584), Sumatera Barat (603) dan Jawa Tengah (338). \"Di Minggu ini Jawa Barat bertambah angka yang cukup besar dan signifikan terhadap angka kasus positif nasional. Ini perlu menjadi perhatian bersama,\" katanya. Selain itu apresiasi diberikan pada Banten, Sulawesi Selatan, Riau dan Papua yang Minggu lalu masuk 5 besar, kini sudah tidak lagi. Pada kasus kematian mingguan ada kenaikan 0,2% atau dari 831 menjadi 833. Dilihat per provinsi, jika dibandingkan minggu lalu, Jawa Tengah masih masuk kedalam 5 besar tertinggi per 29 September 2020. Sedangkan DKI Jakarta, Aceh, Sumatera Utara dan Sumatera Barat sudah berhasil menekan angka kematian dalam sepekan. \"Untuk Jawa Barat, Banten, Riau, dan Kalimantan Timur terjadi kenaikan angka kematian yang cukup signifikan dan masuk dalam 5 besar,\" lanjut Wiku. Secara kabupaten/kota memiliki angka kematian ada 384 atau 74,7% dari 514 kabupaten/kota di Indonesia memiliki tingkat kematian antara 1 - 10. \"Terimakasih kepada 384 kabupaten/kota ini yang telah berhasil menekan angka kematian, karena setiap angka adalah nyawa. Dan kita harus betul-betul bisa menekan angka kematian ini dengan baik. Kami mohon agar seluruh kabupaten/kota memiliki target yang sama, agar kematiannya nol,\" tegas Wiku. Selain itu masih ada 20 kabupaten/kota yang memiliki angka kematian lebih dari 100 orang. Diantaranya Kota Surabaya, Kota Semarang, Jakarta Pusat, Sidoarjo, Jakarta Barat, Jakarta Timur, Kota Makassar, Jakarta Selatan, Kota Medan, Gresik, Jakarta Utara, Kota Palembang, Kota Balikpapan, Kota Malang, Kota Banjarmasin, Demak, Pasuruan, Kota Manado, Kota Mataram dan Kudus. \"Mohon agar memperhatikan kasus dengan gejala sedang dan berat agar dapat ditangani sedini mungkin. Dan masyarakat yang mengalami gejala Covid-19 segera ke dokter dan dapat ditangani segera sebelum bertambah parah,\" pesan Wiku. Untuk pergerakan peta zonasi risiko mingguan per 27 September 2020, berdasarkan kabupaten/kota, zona merah (tinggi) naik dari 58 menjadi 62, zona oranye (sedang) naik dari 304 ke 305, Zona kuning (rendah) naik dari 111 ke 112, zona hijau terdiri dari tidak ada kasus baru turun dari 21 menjadi 19 dan tidak terdampak turun dari 20 menjadi 16. \"Ini adalah peringatan agar kira harus bisa menekan angka penularan dari daerah-daerah yang zonasinya menjadi risiko tinggi. Kami mohon agar betul-betul 16 kabupaten/kota (zona hijau) menjaga wilayah agar tidak terdampak,\" harap Wiku. Selain itu ia membeberkan ada 28 kabupaten/kota yang berhasil menurunkan risiko dari zona merah menjadi zona oranye. Tersebar di 15 provinsi. Apresiasi diberikan kepada 5 kabupaten/kota yang pada pekan lalu turun dari zona merah menjadi zona oranya. Yakni Kota Probolinggo, Lahat, Aceh Selatan, Kotabaru, dan Kota Waringin Timur. \"Namun masih terdapat 5 kabupaten/kota yang Minggu lalu berada di zona merah dan belum dapat menurunkan zona risikonya. Ialah Kota Tangerang, Kota Pekalongan, Kota Cirebon, Jakarta Selatan dan Kutai Kertanegara. Kami mohon agar dapat menurunkan zona risikonya, sampaikan kepada Kementerian Kesehatan dan Satgas Covid-19 apabila memerlukan bantuan,\" imbau Wiku. Disamping itu ada 29 kabupaten/kota lainnya tersebar pada 15 provinsi, yang berhasil menurunkan zona risiko dari oranye menjadi kuning. Namun masih terdapat 8 kabupaten/kota yang pada pekan lalu mendapat perhatian dan belum bisa menurunkan zona risikonya diantaranya Meybrat, Halmahera Barat, Bulukumba, Minahasa Tenggara, Sukamara, Nias Utara, Yalimo dan Sinjai. Jakarta, 29 September 2020 Tim Komunikasi Komite Penanganan Corona Virus Disease 2019 (Covid-19) dan Pemulihan Ekonomi Nasional\r\n', 'https://covid19.go.id/p/berita/tingkat-kesembuhan-covid-19-membaik-pada-399-kabupatenkota');
INSERT INTO `berita` (`id`, `slug`, `judul`, `isi`, `url`) VALUES
(20, 'Prof._Wiku:_Rapid_Test_Antigen_Bisa_Digunakan_Di_Indonesia', 'Prof. Wiku: Rapid Test Antigen Bisa Digunakan Di Indonesia', '\r\nJAKARTA - Satgas Penanganan Covid-19 menilai Indonesia dimungkinkan bisa menggunakan rapid test antigen sesuai rekomendasi Badan Kesehatan Dunia atau World Health Organization (WHO). Rapid test ini dijelaskan Juru Bicara Satgas Penanganan Covid-19 Prof. Wiku Adisasmito bisa mengeluarkan hasil test Covid-19 dalam beberapa menit. \"Tentunya alat ini bisa digunakan di Indonesia sesuai yang direkomendasikan WHO dan bisa menggantikan rapid test antibody, dan fungsi screening yang dilakukan rapid test tersebut menjadi lebih efektif dan tidak menjadi beban untuk RT PCR sebagai standar penegakan diagnosa,\" ia menanggapi pertanyaan media dalam jumpa pers yang disiarkan kanal YouTube Sekretariat Presiden, Selasa (29/9/2020). Selain itu Satgas Penanganan Covid-19 tengah mengkaji sasaran prioritas vaksin yang disesuaikan dengan kelompok risiko penularan virus Covid-19. Termasuk elemen-elemen yang diperlukan dalam vaksinasi itu mulai dari supply, pembiayaan, serta mekanisme infrastruktur yang perlu disiapkan. Juru Bicara Satgas Penanganan Covid-19 Prof. Wiku Adisasmito meminta masyarakat bersabar menunggu pemerintah mematangkan rencana vaksinasi untuk masyarakat. Ia memastikan pemerintah akan menyampaikan kepada masyarakat sebelum pelaksanaannya. \"Nanti setelah rencana matang dan jelas, akan kami sampaikan kepada masyarakat rencana vaksinasi itu lebih detail. Dan tentunya itu disesuaikan dengan ketersediaan vaksin yang ada untuk melindungi seluruh masyarakat Indonesia,\" jelas Wiku masih menjawab pertanyaan media. Wiku juga menyayangkan adanya persepsi di masyarakat yang menyatakan kebal terhadap Covid-19. Ia kembali menekankan bahwa tidak ada masyarakat yang kebal terhadap Covid-19. Dan virus ini tidak mengenal strata sosial, ataupun jabatan seseorang. \"Jangan sekali-kali kita berpikir karena rajin berolah raga atau berdiam diri di rumah, kita bisa kebal. Karena tertular itu bisa mudah terjadi dari siapapun yang kita temui,\" kata Wiku. Untuk itu pemerintah katanya mengedepankan perilaku 3M, memakai masker, menjaga jarak dan mencuci tangan. Untuk masyarakat yang sudah paham agar mendapatkan orang lainnya yang belum sadar sepenuhnya penularan virus Covid-19. Dengan tingginya tingkat kesadaran masyarakat, maka Indonesia bisa menjadi kekuatan besar untuk melawan virus Covid-19. Begitu juga antar negara melakukan hal yang sama untuk melindungi secara lokal, nasional dan global. \"Sampai sekarang kampanye 3M ini dibantu rekan-rekan relawan dari banyak tempat. Kami juga berkerja keras agar relawan bisa berkampanye menggunakan pendekatan sosial budaya sesuai keadaan masing-masing wilayah,\" ungkapnya. Untuk itu Wiku meminta masyarakat agar memiliki tanggung jawab yang tinggi dan kolektif untuk mematuhi protokol kesehatan. Karena untuk menekan angka kematian pasien Covid-19, dimulai dari menekan angka penularan. \"Semakin kita menghindari penularan terhadap kelompok rentan yaitu usia lanjut dan penderita komorbid, maka potensi menurunkan angka kematian sangat besar,\" jelas Wiku. Jakarta, 29 September 2020 Tim Komunikasi Komite Penanganan Corona Virus Disease 2019 (Covid-19) dan Pemulihan Ekonomi Nasional\r\n', 'https://covid19.go.id/p/berita/prof-wiku-rapid-test-antigen-bisa-digunakan-di-indonesia');
